import { Link } from "@material-ui/core";
import React from "react";
import {NavLink} from 'react-router-dom';

const Menu=()=>
{

    return(
<>
<div className="menu_style">
{/*<Link to='/'>About Us</Link>
<Link to='/contact'>Contact</Link>*/}

<br>

</br>

<NavLink exact to='/' activeClassName="active_class">About Us</NavLink>
<NavLink to='/services' activeClassName="active_class">Services</NavLink>
<NavLink to='/user' activeClassName="active_class">User</NavLink>

<NavLink to='/contact' activeClassName="active_class">Contact</NavLink>


</div>

</>
    );
};


export default Menu;
